const getRetweenButton = (count) => {
    if(count > 0) {
      return(
        <span className="retweet-count">
          {count}
        </span>
      )
    } else {
      return null
    }
  }

  const RetweetButton = ({count}) => {
    return(
        <span className="retweetButton"> 
        <i className="fa fa-retweet"/>
        {getRetweenButton(count)}
        </span>
    )
  }

  export default RetweetButton;
